export default{
    name:"SellerAccountComponent",
    mounted()
    {
        getSellerDetails
        getsellerproducts({
            sellerid,
            success: ({ data }) => {
                console.log(data)
                commit('setSellerproducts', data)
            },
            error: (e) => {
                commit('setSellerproducts', [])
                console.warn(e);
            }

        })
    }
}
